import oceansJPG from "./Albums/images/oceans-the-blue-stones.jpg";
import masterBlasterJPG from "./Albums/images/master-blaster-stevie-wonder.jpg";
import noDiggityJPG from "./Albums/images/no-diggity-chet-faker.jpg";
import suitInTheBackJPG from "./Albums/images/suit-in-the-back-quaker-city-night-hawks.jpg";
import highNoMoreJPG from "./Albums/images/high-no-more-hajaj.jpg";
import desireJPG from "./Albums/images/desire-warhaus.jpg";
import whiskeyJPG from "./Albums/images/whiskey-tejon-street-corner-thieves.jpg";

import oceansMP3 from "./songFiles/oceans-the-blue-stones.mp3";
import masterBlasterMP3 from "./songFiles/stevie-wonder-master-blaster.mp3";
import noDiggityMP3 from "./songFiles/no-diggity-chet-faker.mp3";
import suitInTheBackMP3 from "./songFiles/suit-in-the-back-quaker-city-night-hawks.mp3";
import highNoMoreMP3 from "./songFiles/high-no-more-hajaj.mp3";
import desireMP3 from "./songFiles/desire-warhaus.mp3";
import whiskeyMP3 from "./songFiles/whiskey-tejon-street-corner-thieves.mp3";

const songData = [
    {
        title: "Oceans",
        artist: "The Blue Stones",
        image: oceansJPG,
        mp3: oceansMP3
    },
    {
        title: "Master Blaster (Jammin')",
        artist: "Stevie Wonder",
        image: masterBlasterJPG,
        mp3: masterBlasterMP3
    },
    {
        title: "No Diggity",
        artist: "Chet Faker",
        image: noDiggityJPG,
        mp3: noDiggityMP3
    },
    {
        title: "Suit in the Back",
        artist: "Quaker City Night Hawks",
        image: suitInTheBackJPG,
        mp3: suitInTheBackMP3
    },
    {
        title: "High No More",
        artist: "Hajaj",
        image: highNoMoreJPG,
        mp3: highNoMoreMP3
    },
    {
        title: "Desire",
        artist: "Warhaus",
        image: desireJPG,
        mp3: desireMP3
    },
    {
        title: "Whiskey",
        artist: "Tejon Street Corner Thieves",
        image: whiskeyJPG,
        mp3: whiskeyMP3
    }
];

export default songData;
